import React from 'react';
import { Pie } from 'react-chartjs-2';
import '../css/Chart.css';

const data = {
    labels: ['Basketball', 'Strength', 'Recovery'],
    datasets: [
        {
            data: [50, 25, 25],
            backgroundColor: ['#ff9800', '#2196f3', '#9c27b0'],
            hoverBackgroundColor: ['#ffa726', '#64b5f6', '#ba68c8'],
        },
    ],
};

const options = {
    responsive: true,
    maintainAspectRatio: false,
};

const ChartComponent = () => {
    return (
        <div className="chart-container">
            <h2>Next week</h2>
            <Pie data={data} options={options} />
            <div className="workout-info">
                <h3>Time since last workout</h3>
                <ul>
                    <li><span>Strength</span> <span>1 day</span></li>
                    <li><span>Basketball</span> <span>3 days</span></li>
                    <li><span>Recovery</span> <span>6 days</span></li>
                </ul>
            </div>
        </div>
    );
};

export default ChartComponent;
